Independent, Local Specialty Stores. These stores generally range in size from approximately 2,000 to 10,000 square feet, and typically focus on more than one specific product categories, such as hunting, fishing or camping. Other Specialty Retailers. Some of the other specialty retailers that compete with us across a significant portion of our merchandising categories are large-format retailers, with stores that generally range in size from 40,000 to 250,000 square feet. These retailers seek to offer a broad selection of merchandise focused on hunting, fishing, camping and other outdoor product categories. Some of these stores combine the characteristics of an outdoor retailer with outdoor entertainment and theme attractions. We believe that the number of these stores that can be supported in any single market area is limited because of their large size and significant per-store buildout cost.

