Our operating results are subject to seasonal fluctuations. We experience moderate seasonal fluctuations in our net sales and operating results. On average over the last three fiscal years, we have generated 26.3% and 27.8% of our annual net sales in the third and fourth fiscal quarters, respectively, which includes the holiday selling season as well as the opening of the fall hunting season. We incur additional expenses in the third and fourth fiscal quarters due to higher purchase volumes and increased staffing in our stores. If, for any reason, we miscalculate the demand for our products or our product mix during the third or fourth fiscal quarters, our sales in these quarters could decline, resulting in higher labor costs as a percentage of sales, lower margins and excess inventory, which could cause our annual operating results to suffer and our stock price to decline. Due to our seasonality, the possible adverse impact from other risks associated with our business, including atypical weather, consumer spending levels and general economic and business conditions, is potentially greater if any such risks occur during our peak sales seasons.

